import itertools
import cProfile


def has_common_character(word1, word2):
    character_set = set()
    for c in word1:
        character_set.add(c)
    for c in word2:
        if c in character_set:
            return True
    return False


def brute_force(words):
    words_length = len(words)
    max_product = 0
    for i in range(words_length):
        for j in range(i + 1, words_length):
            if not has_common_character(words[i], words[j]):
                max_product = max(len(words[i]) * len(words[j]), max_product)
    return max_product


####################################


def use_mask(words):
    words = sorted(words, key=len)
    word_dict = {}
    for word in words:
        num = sum(1 << (ord(c) - 97) for c in set(word))
        length = len(word)
        word_dict[num] = length

    max_product = 0
    for k1, k2 in itertools.combinations(word_dict, 2):
        if not k1 & k2:
            max_product = max(max_product, word_dict[k1] * word_dict[k2])
    return max_product


def two_line(words):
    d = {sum(1 << (ord(c) - 97) for c in set(w)): len(w) for w in sorted(words, key=len)}
    return max([d[k] * d[K] for k, K in itertools.combinations(d, 2) if not K & k] or [0])


